import { Menu, Container } from "semantic-ui-react";
import Link from 'next/link';
import Image from 'next/image';
export const config = { amp: true }

function Header() {
  return <>
    <Menu fluid id="menu" inverted >
      <Container text>
        <Link href="/"> 
          <Menu.Item header>
            <Image 
              src="/public/logo.svg"
              responsive
            />
            ReactReserve
          </Menu.Item>
        </Link>
      </Container>
    </Menu>
  </>
}

export default Header;
